import React from 'react';

const Select = props => (
  <div>
    {/*<div style={{ marginBottom: 5 }}>{props.text}</div>*/}
    <select
      name={props.name}
      value={props.value}
      onChange={props.handleInputChange}
    >
      <option value="" disabled hidden>
        {props.placeholder}
      </option>
      {props.values.map(value => {
        return (
          <option key={value} value={value}>
            {value}
          </option>
        );
      })}
    </select>
  </div>
);

export default Select;
